import { useNavigate } from "react-router-dom";

const handleLogout = () => {
  // Limpiar el estado de la sesión del usuario
  setLoggedInUser(null);
  setIsAdmin(false);
  // Redirigir al usuario a la página de inicio de sesión
  const navigate = useNavigate();
  navigate("/login");
};

export { handleLogout };
